import React from "react";
import "./UserLayoutStyle.css";
import { Link } from "react-router-dom";

const UserLayout = ({ LogOut, children }) => {
  return (
    <div className="user_layout">
      <div className="row">
        <div className="col-3">
          <div className="user_layout_sidebar">
            <h3>Навигация</h3>
            <Link to={"/my_profile"}>Моят профил</Link>
            <div onClick={LogOut}>Изход</div>
          </div>
        </div>
        <div className="col-9">
          <div className="user_content_layout">{children}</div>
        </div>
      </div>
    </div>
  );
};

export default UserLayout;
